oNormal\"><b style=\"mso-bidi-font-weight:normal\">Totální cyklistika,\r\ntěmito dvěma slovy bychom mohli shrnout závěrečnou etapu letošního ročníku\r\nParis-Nice. Ta sice měřila pouze 120km, ale i to bylo dostatek na to, aby se\r\nzávodníci do cíle trousili samostatně nebo po malých skupinkách. Stejně jako v\r\npředchozích dnech byl velmi aktivní tým Ineos Grenadiers, který se konečně\r\ndočkal vítězství díky Američanovi Magnusi Sheffieldovi. Ten porazil i svého\r\nkrajana Mattea Jorgnsona. Ten ale nemusel smutnit, jelikož obhájil celkové\r\nvítězství.</b></p>\r\n\r\n<p class=\"MsoNormal\">Závěrečný den závodu za sluncem startoval i finišoval v\r\nNice. Na trati na jezdce čekala hned 4 <b style=\"mso-bidi-font-weight:normal\">náročná\r\nstoupání, která vystřelila celkové převýšení dne na hodnotu 2100 metrů</b>.\r\nNavíc většina z kopců, jež dnes jezdci absolvovali, dosahovala průměrného\r\nsklonu přes 8 %, což jen umocnilo náročnost etapy.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Hned z kraje závodu byl velmi aktivní <b style=\"mso-bidi-font-weight:\r\nnormal\">Mads Pedersen, který si na sprinterské prémii chtěl pojistit dres\r\nnejlepšího sprintera</b>. Jeho počínání v úvodním stoupání ale bojkotoval tým\r\nIneos Grenadiers, který rozjel pekelné tempo. To hlavní skupinu hodně\r\nzredukovalo a dokonce odpadli i <b style=\"mso-bidi-font-weight:normal\">všichni\r\ntýmoví kolegové lídra závodu Jorgensona.</b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></b></p>\r\n\r\n<p class=\"MsoNormal\">V druhém stoupání dne už na čele zbyla pouze malá skupina.\r\nTo vedlo k velkému počtu nástupů, které <b style=\"mso-bidi-font-weight:normal\">musel\r\npokrývat sám Jorgenson jedoucí ve žlutém dresu lídra závodu. Američan zvolil pravidelné tempo</b>.\r\nSice se ze skupiny hlavních favoritů oddělila dvojice Gall a Vlasov, ale to\r\nAmeričanovi až tak nevadilo, jelikož jejich náskok nepřesahoval 30 sekund. <b style=\"mso-bidi-font-weight:normal\">Na horizontu druhého kopce se od hlavních\r\nfavoritů vzdálil i Magnus Sheffield.</b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></b></p>\r\n\r\n<p class=\"MsoNormal\">Jako třetí v pořadí přišel na řadu kopec <b style=\"mso-bidi-font-weight:normal\">Col d\'Éze. Na něj na čele vjížděla skupinka\r\nve složení Pedersen, Vlasov, Scheffield a Gall</b>. Na konci tohoto kopce se\r\nnacházela sprinterské prémie. Tu s vypětím všech sil získal Mads Pedersen,\r\nkterý si díky tomu zajistil dres pro nejlepšího sprintera. V hlavní skupině <b style=\"mso-bidi-font-weight:normal\">mezitím zaútočil Matteo Jorgenson</b>.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">V tu chvíli zbývalo ještě 35km do cíle, které byly převážně\r\nve sjezdu, ale <b style=\"mso-bidi-font-weight:normal\">jezdce strašilo ještě\r\njedno stoupání.</b> V něm už to byla totální cyklistika. Jako jediný dokázal\r\nnáporu Mattea Jorgensona vzdorovat Magnus Schffield. <b style=\"mso-bidi-font-weight:\r\nnormal\">Do cíle tak Jorgenson dorzail na druhém místě, což mu zajistilo\r\nobhajobu celkového vítězství</b>. Dvaadvacetiletý Scheffield dorazil do cíle 29\r\nsekund před svým krajanem a oslavil své první velké vítězství v kariéře.</p><p class=\"MsoNormal\"><p></p><div class=\"iframe\"><blockquote class=\"twitter-tweet\" data-media-max-width=\"560\"><p lang=\"en\" dir=\"ltr\">🗣️ \"I’ve been second so many times now. It’s my first victory at the WorldTour level.<br><br>\"In cycling it’s just so hard to win any race. It means so much.\"<a href=\"https://twitter.com/MagnusSheffield?ref_src=twsrc%5Etfw\">@MagnusSheffield</a> ☑️ <a href=\"https://twitter.com/hashtag/ParisNice?src=hash&amp;ref_src=twsrc%5Etfw\">#ParisNice</a> 🇫🇷<a href=\"https://t.co/YitcJbHcIh\">pic.twitter.com/YitcJbHcIh</a></p>— INEOS Grenadiers (@INEOSGrenadiers) <a href=\"https://twitter.com/INEOSGrenadiers/status/1901314965748744579?ref_src=twsrc%5Etfw\">March 16, 2025</a></blockquote> <script async=\"\" src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script> </div><br></p>\r\n\r\n<p class=\"MsoNormal\">Šesté místo si v závěrečné etapě připsal <b style=\"mso-bidi-font-weight:normal\">Florian Lipowitz. Ten si díky tomu zajistil\r\ndruhou příčku v celkovém pořadí a bílý dres pro nejlepšího mladého závodníka</b>.\r\nCelkové pódium doplnil Thymen Arensman. Nejlepším vrchařem závodu se stal\r\nThomas Gachignard. A jak již bylo zmíněno, tak zelený <b style=\"mso-bidi-font-weight:\r\nnormal\">dres pro nejlepšího sprintera si z Nice odvezl Mads Pedersen</b>.</p><p class=\"MsoNormal\"><img src=\"data:image/png;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Sledovali jste\r\nnějakou z etap Paris-Nice?</b></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">&nbsp;</b></p>\r\n\r\n', 6, 'zaverecna-etapa-paris-nice-prinesla-velkou-americkou-show-jorgenson-zvitezil-celkove-a-sheffield-bral-etapu');